//SPDX-License-Identifier:MIT
pragma solidity ^0.8.15;


 contract crowdFunding{

 	mapping (address => uint) public fundContributors;
 	address public manager; // administrador del contrato
 	uint public deadline; // tiempo de vigencia de la campaña
 	uint public targetAmount;  // objetivo de la campaña
 	uint public raisedAmount; // cantidad recauadada

 	struct Request {
     	string description;
     	address payable recipient;
     	uint value;
     	bool completed;
 	}

 	mapping (uint => Request) public requests;
 	uint public numRequests;

 	constructor (uint _targetAmount, uint _deadline) {
     	targetAmount = _targetAmount;
     	deadline = block.timestamp + _deadline;
     	manager = msg.sender;

 	}

 	function sendFunds() public payable {

 	require(block.timestamp < deadline, "Termino la deadline :(");
 	fundContributors[msg.sender] += msg.value;
 	raisedAmount += msg.value;

 	}

 	function getBalance() public view returns(uint){
     	return address(this).balance;
 	}

	// funcion de reembolso
 	function refund() public {
     	require(block.timestamp > deadline && raisedAmount < targetAmount, "No se puede reembolsar ...");
     	uint amountToRefund = fundContributors[msg.sender];
     	require(amountToRefund > 0, "No pusiste pa la vaca");

    	(bool success, ) = address(msg.sender).call{ value: amountToRefund} ('');
    	require(success, "La transferencia fallo");
     	fundContributors[msg.sender] = 0;

 	}

 	modifier onlyManager() {

     	require(msg.sender == manager, "Solo el administrador puede ejecutar esta funcion");
     	_;
 	}

 	function createRequest (string memory _description, address payable _recipient, uint _value) public onlyManager {
     	Request storage newRequest = requests[numRequests];
     	numRequests++;
     	newRequest.description = _description;
     	newRequest.recipient = _recipient;
     	newRequest.value = _value;
     	newRequest.completed = false;
 	}

 	function makePayment (uint _requestNo) public onlyManager{

     	require (raisedAmount >= targetAmount);
     	Request storage thisRequest = requests[_requestNo];
     	require(thisRequest.completed == false , "Esta peticion no fue completada");
     	thisRequest.recipient.transfer(thisRequest.value);
     	thisRequest.completed = true;
 	}  
 }

